INSERT INTO `data` (`id`, `title`, `content`) VALUES
(11, 'Online manifestacija PUP- Psihologija u praksi 2021', 'U okviru Školskog programa profesionalnog informiranja i usmjeravanja obavijest za učenike završnih razreda zainteresirane za područje psihologije o održavanju  na daljinu manifestacije PuP – Psihologija u praksi 2021″ 9.-10.travnja 2021.\r\n\r\nPuP – Psihologija u praksi stručni je skup kojeg organizira Klub studenata psihologije Hrvatskih studija Sveučilišta u Zagrebu Feniks.\r\n\r\nOsnovni cilj PuP-a je predstaviti studentima psihologije, kao i svima koje psihologija zanima, iskustvo psihologa zaposlenih u različitim područjima struke.\r\n\r\nUz  zanimljiva online predavanja, posjetitelji mogu sudjelovati u online radionicama koje nude aktivniji način učenja o različitim aspektima struke, ali i o samom studiju psihologije.\r\n\r\nViše o programu i poveznicama pratite na: https://www.facebook.com/events/793856091221995/?active_tab=discussion'),
(12, 'Zdravstvena psihologija - obavijest o online simpoziju', 'U petak, 16. listopada 2021, Strukovna udruga austrijskih psihologa i Austrijska akademija za psihologiju će održati internetsku konferenciju o zdravstvenoj psihologiji.\r\nTijekom konferencije domaći i međunarodni govornici, između ostalog, govorit će o uspješnoj komunikaciji o čimbenicima rizika. Teme su isto tako zdravo starenje i pitanje značajnih inicijativa u području zdravstva. Simpozij je namijenjen:\r\n\r\nPsiholozima\r\nKliničkim psiholozima\r\nZdravstvenim psiholozima\r\nKliničkim psiholozima u treningu\r\nStudentima psihologije\r\nZdravstvenim psiholozima u treningu\r\nLiječnicima'),
(13, 'VAŽNO!! Coronavirus COVID 19 i uloga psihologa: EFPA obavijest', 'Kao psiholozi prirotet nam je koristiti psihološka znanja kako bismo u ispravnoj komunikaciji o virusu pomogli izbjeći nepotrebnu anksioznost i podržali ljude koji su virusom pogođeni. Stoga su u nastavku navedeni neki korisni savjeti o tome:\r\n\r\n1. Reagirajte u skladu s lokalnom situacijom: Kako se situacija razlikuje od zemlje do zemlje, prilagodite se specifičnoj situaciji u vašoj zemlji. Stoga potičemo naše udruge članice da stupe u kontakt sa njihovim lokalnim zdravstvenim vlastima i promoviraju njihovu službenu procjenu i smjernice.\r\n2. Osigurajte točne činjenice: pomozite ljudima da osiguraju dobiti prave činjenice. Vlade pružaju objektivne informacije o virusu u vašoj zemlji putem web lokacija na koje se možete uputiti. Europski centar za prevenciju bolesti (ECDP) i kontrolu ima posebno web mjesto o Coronavirusu koje redovito ažurira: Covid 19 \r\n3. Komunicirajte s djecom: razgovarajte o vijestima o koronavirusu na način primjeren dobi. Roditelji također mogu pomoći ublažiti nevolju usredotočujući djecu na rutine i rutinska ponašanja. Zapamtite da će djeca promatrati ponašanja i osjećaje roditelja te tako upravljati vlastitim osjećajima tijekom vremena.\r\n4. Ostanite povezani u sigurnosti: Održavanjem društvenih mreža može se potaknuti osjećaj normalnog funkcioniranja i pružiti vrijedna mjesta za razmjenu osjećaja i oslobađanje od stresa. Potaknite ljude da s prijateljima i obitelji dijele korisne informacije na službenim mrežnim stranicama. I u slučaju karantene, ljudi još uvijek mogu održavati kontakte na daljinu.\r\n5. Suočavanje s karantenom: Prof. Atle Dyregrov, bivši član EFPAinog  Stalnog odbora za krizu, traumu i katastrofu napisao je tekst koji pruža vrlo korisne informacije o podršci ljudima koji se moraju nositi sa situacijom u karanteni. Lancet je objavio zanimljiv pregled o psihološkom utjecaju karantene i kako je smanjiti.\r\n6. Podržite ljude da potraže dodatnu pomoć: Pojedinci koji osjećaju neprestanu nervozu, dugotrajnu tugu ili druge dugotrajne reakcije koje nepovoljno utječu na njihov posao ili međuljudske odnose trebali bi se posavjetovati s obučenim i iskusnim stručnjakom za mentalno zdravlje.\r\n7. Promicanje sigurnosti: ljudi mogu poboljšati sigurnost slijedeći smjernice o osobnoj zaštiti, ekološkim protumjerama, protumjerama društvenog udaljavanja i protumjerama povezanim s putovanjima kako je objašnjeno u ECDP: Smjernice o nefarmaceutskim protumjerama.'),
(14, 'PRVI POZIV NA VII. KONGRES PSIHOLOGA BIH', 'Poštovane kolegice i kolege,\r\n\r\nČast nam je obavijestiti vas da će se VII. kongres psihologa Bosne i Hercegovine sa međunarodnim učešćem održati od 12-15. maja 2022. godine u Tuzli. \r\n\r\nOrganizator Kongresa je Savez društava Bosne i Hercegovine - Društvo psihologa Federacije BiH, Društvo psihologa Republike Srpske i Društvo psihologa Brčko Distrikta.\r\nKongres će uključivati sve radove iz oblasti psihologije u vidu usmene prezentacije, poster prezentacije, tematskih simpozija i okruglih stolova.\r\n\r\nVažni datumi: \r\nRok za slanje sažetaka i krajnji rok za prijavu i ranu kotizaciju – 01.12.2021.\r\nRok za slanje radova – 01.03.2022.\r\n\r\nRadujemo se učešću i druženju u Tuzli.\r\n\r\nProgramski i organizacioni odbor'),
(15, 'SARADNJA DRUŠTVA PSIHOLOGA FBIH SA UNICEFOM U BIH, UZ PODRŠKU VLADE ŠVEDSKE', 'Medijska saopštenja nadležnih službi uveliko govore o dolasku četvrtog vala pandemije. Podsjećamo da je Društvo psihologa FBiH u saradnji sa Unicefom u BiH uz podršku Vlade Švedske, u periodu od juna 2020. godine do aprila 2021. godine realizovalo projekat pod nazivom \"Jačanje zaštite mentalnog zdravlja stručnjaka i ranjivih skupina u FBiH\". Realizaciju kompletnog projekta su iznijeli aktivni članovi Društva psihologa u FBiH, tačnije njih 32 (od 55 prijavljenih kandidata) uz 5 regionalnih koordinatora projekta. Teritorijalna zastupljenost odabranih psihologa je bila objektivna pretpostavka ravnomjernog obuhvatanja ciljnih grupa. Gledano po Podružnicama u projektu su učestvovali: podružnica Sarajevo (Amila Ferušić Korkut, Zvjezdana Savić, Dželila Mulić Čorbo, Jasmina Buljić, Mediha Kovačević, Šuajb Solaković, Vildana Efendić, Senka Čimpo, Merima Pašalić, Dženan Fatić); podružnica Tuzla (Elvis Vardo, Dajana Stajić, Edin Nišić, Samira Selesković, Snežana Sarihodžić, Tamara Efendić Spahić), podružnica Hercegovina (Andrea Šetka, Ivona Čarapina Zovko, Marijana Šuvak Martinović, Tea Vučina, Silvija Jurčević, Maja Pandža Topić), podružnica Zenica (Nermina Vehabović Rudež, Esmin Brodlija, Olivera Đokić, Sedin Habibović); podružnica Srednja Bosna (Ivana Đotlo, Senaida Šijak); Unsko-sanska podružnica (Ensad Miljković, Vildana Aziraj, Mirela Mujagić). Projektne aktivnosti su usmjerene prema tri kategorije:- Kreiranje stručnog sistema reagovanja na krizu izazvanu COVID 19 pandemijom, utemeljenog na empirijskim dokazima indikatora mentalnog zdravlja ciljne grupe stručnjaka i ranjivih profesija--Unapređenje nivoa zaštite mentalnog zdravlja profesionalaca iz pomagačkih profesija, roditelja/staratelja i ranjivih grupa-Unapređenje nivoa zaštite mentalnog zdravlja djece i nastavnika.\r\n\r\n'),
(16, 'PONOVO U PONUDI CPP-A: R-PAS - SAVREMENI SISTEM INTERPRETACIJE RORŠAH METODA – OD NOVEMBRA 2021. GODINE', 'Program obuhvata inovacije u oblasti istraživanja i primene Roršah metoda poslednjih godina. Namenjen je psiholozima koji već imaju bazično znanje o Eksnerovom sistemu interpretacije i žele da razvijaju i unapređuju svoje kompetencije u oblasti procene ličnosti. Početak kursa planiran je za novembar 2021. godine i predviđa 8 online susreta (nedeljom) putem ZOOM aplikacije.\r\nRezervišite na vreme svoje mesto u grupi slanjem podataka (ime i prezime, kontakt telefon, scan diplome ili registracioni broj iz baze psihologa Društva psihologa Srbije, sertifikat o završenom osnovnom kursu interpretacije Roršah metoda po Obuhvatnom modelu Džona Eksnera), na mail adrese cpp@dps.org.rs i dpscpp@orion.rs.  '),
(17, 'VAŽNO OBAVEŠTENJE ZA UČESNIKE KONGRESA PSIHOLOGA 2021', 'Poštovane koleginice i kolege, \r\n\r\nZbog epidemiološke situacije koja, na žalost, još uvek ne dozvoljava naše okupljanje u Vrnjačkoj Banji, Izvršni odbor DPS je doneo odluku da se i ove godine Kongres psihologa održi u online formatu. \r\n\r\nPodsećamo učesnike sa radom da rok za uplatu kotizacije (koja omogućava ulazak rada u knjigu rezimea) ističe 1. septembra, i da, ukoliko to nisu učinili do sada, u najkraćem mogućem roku ispune taj uslov, s obzirom da je knjiga rezimea u završnoj fazi izrade.\r\n\r\nNa sajtu DPS kao i zvaničnoj Fejsbuk stranici će blagovremeno biti istaknut prijavni formular za učesnike Kongresa na osnovu koga ćemo učesnicima dostaviti podatke za pristup sadržajima Kongresa, te vas molimo da redovno pratite sadržaje na našim glasilima. '),
(19, 'Niko ko olakšava teret drugome nije beskoristan na ovome svijetu.  (Charles Dickens)', 'Novo savjetovalište u našem gradu. Svakodnevno i neumorno vam pružamo ruku na putu samoostvarenja i dajemo krila u trenucima kad se ne usuđujete napraviti iskorak i pokrenuti promjene. Pomažemo da lakše prođete kroz teška životna razdoblja i nudimo smjernice kako da u različitim situacijama pomognete sebi i poboljšate kvalitet života.');

